impl Solution {
    pub fn maximum_strong_pair_xor(nums: Vec<i32>) -> i32 {
        let mut result = 0;
        for i in 0..31 {
            let mut max_val = 0;
            let mut count = 0;
            for &num in &nums {
                if (num >> i) & 1 == 1 {
                    max_val = max_val.max(result ^ num);
                    count += 1;
                }
            }
            if count > 1 {
                result = max_val;
            }
        }
        result
    }
}
